render function
*/
import { awFooterRenderFunction } from 'js/AwFooterService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwFooterService', () => import('js/AwFooterService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awFooterRenderFunction",
            "deps": "js/AwFooterService"
        }
    },
    "ctx": {
        "user": null
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "_viewModelId": "AwFooter",
    "_uniqueViewModelId": "AwFooter"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awFooterRenderFunction, undefined, ctxImportObj );

export default Component;
